import React from 'react'
import classes from './UserList.module.css'
import Card from '../UI/Card'


const UserLists = (props) => {
    return (
        <Card className={classes.users} >
            <ul>
                {props.users.map(user => (
                    <li>
                        {user.name}
                        ({user.age} year old)}
                    </li>
                )
                )}
            </ul>
        </Card>
    )
}


export default UserLists;
